export default function UserCard() {
  return (
    <div className="user-card">
      <img
        src="https://t4.ftcdn.net/jpg/00/64/67/63/360_F_64676383_LdbmhiNM6Ypzb3FM4PPuFP9rHe7ri8Ju.jpg"
        alt="uknow-user"
      />
      <h1>Name</h1>
      <p> Miembro desde</p>
      <p>
        <button>Add Friend</button>
      </p>
    </div>
  );
}
